import React from "react";
import web from "./img/spain.png";
const Sdata = [
  {
    imgsrc: { web },
    title: "webtitle",
  },
  {
    imgsrc: { web },
    title: "apptitle",
  },
  {
    imgsrc: { web },
    title: "reacttitle",
  },
  {
    imgsrc: { web },
    title: "software",
  },
  {
    imgsrc: { web },
    title: "javatitle",
  },
  {
    imgsrc: { web },
    title: "pythontitle",
  },
];
export default Sdata;
